import React from 'react'

export default function index() {

    const data = {
        class1: {
            title: 'CS 162',
            professor: 'Brandilyn Coker'
        },
        class2: {
            title: 'CS 271',
            professor: 'Paris Kalathas'
        }
    }; 

  return (
    <div>
        <input style={searchbox} placeholder="Search classes or professors"/>
        <div style={searchresults}>
            {data.map((title, professor) => 
            <div>
                {title}{professor}
            </div>
            )}
        </div>
    </div>
  )
}

const searchbox = {
  padding: 8,
  background: '#f5f5f5',
  borderRadius: 8,
  width: 300,
  appearance: 'none',
  border: '1px solid rgb(166, 166, 166)',
}

const searchresults = {

}
